Insert into ITMT_I (ID,ID_IDIOMA,TITULO,ENTRADILLA,ALTIMAGEN,ENTRADILLA_LISTA_DESCARGA) values ('563','0','Medidas adoptadas por las CCAA para la atención al alumnado inmigrante',null,null,'Los siguientes documentos recogen informaci&oacute;n detallada sobre el modo en que las distintas Comunidades Aut&oacute;nomas y las Ciudades Aut&oacute;nomas de Ceuta y Melilla abordan la educaci&oacute;n intercultural, as&iacute; como las medidas que se han establecido para prestar atenci&oacute;n a las necesidades del alumnado inmigrante en el &aacute;mbito de su territorio.');
Insert into ITMT_I (ID,ID_IDIOMA,TITULO,ENTRADILLA,ALTIMAGEN,ENTRADILLA_LISTA_DESCARGA) values ('564','0','Síntesis de las medidas adoptadas en las CCAA para atender las necesidades educativas del alumnado inmigrante',null,null,'<p>La informaci&oacute;n que se recoge en este documento se presenta en forma de tablas-resumen y se distribuye en los siguientes apartados: enfoque multicultural de la educaci&oacute;n, acogida al alumnado inmigrante, medidas organizativas y curriculares, apoyo ling&uuml;&iacute;stico y cultural, atenci&oacute;n a las familias, formaci&oacute;n del profesorado y otros recursos. </p>');
