Insert into ITMT_I (ID,ID_IDIOMA,TITULO,ENTRADILLA,ALTIMAGEN,ENTRADILLA_LISTA_DESCARGA) values ('737','0','Colección del CREADE',null,null,'Iniciamos la colecci&oacute;n de audiovisuales CREADE con dos materiales:<br /><br />-&nbsp; <em>Kaleidoschool / Caleidoescuela.</em> Este v&iacute;deo ha sido elaborado en el marco del Proyecto Socrates-Comenius 2.1,&nbsp;<em>INTER: una gu&iacute;a pr&aacute;ctica para aplicar la educaci&oacute;n intercultural en la escuela</em>,&nbsp;coordinado por el Grupo INTER de la Universidad Nacional de Educaci&oacute;n a Distancia (UNED).&nbsp;A trav&eacute;s de entrevistas a diferentes personas y grabaciones en diversos&nbsp; colegios, padres y madres, alumnos, profesores y directores de escuelas comparten con nosotros sus ideas sobre la educaci&oacute;n, sus expectativas y preocupaciones, y nos cuentan sus experiencias. El v&iacute;deo constituye una excusa para reflexionar y reconsiderar una serie de estereotipos e ideas preconcebidas que se encuentran en la base de muchas pr&aacute;cticas educativas convertidas en rutinas invariables, y para pensar en estrategias alternativas relacionadas con la aplicaci&oacute;n del enfoque intercultural en educaci&oacute;n.<br /><br />- <em>Trafficombo</em>, realizado por&nbsp; OjoRojo Producciones, en Ecuador. A trav&eacute;s de una interesante combinaci&oacute;n del g&eacute;nero documental con la ficci&oacute;n, proporciona claves para analizar y comprender las circunstancias en las que se desarrollan las migraciones,&nbsp;aportando una perspectiva nueva y distinta sobre el fen&oacute;meno y, por encima de todo, sobre las personas implicadas en &eacute;l: las circunstancias en las que se desarrollan las migraciones, la incertidumbre y el riesgo que asumen los protagonistas, la manipulaci&oacute;n y la despersonalizaci&oacute;n de que son objeto, las implicaciones afectivas, familiares y econ&oacute;micas&nbsp;de su partida, y las transformaciones sociales y culturales que provoca en el pa&iacute;s de origen una emigraci&oacute;n masiva como la que sufre en estos momentos Ecuador.<br /><br />Se requiere Flash player para visualizar los v&iacute;deos. <a href="http://www.adobe.com/shockwave/download/index.cgi?P1_Prod_Version=ShockwaveFlash&amp;Lang=Spanish" target="_new">Haga click aqu&iacute; para descargarlo</a>');
