Insert into ITMT_I (ID,ID_IDIOMA,TITULO,ENTRADILLA,ALTIMAGEN,ENTRADILLA_LISTA_DESCARGA) values ('27','0','Colecciones de fotos','<p>Ofrecemos estas primeras colecciones de fotos con la intenci&oacute;n de iniciar un proyecto com&uacute;n en el que todas y todos podamos compartir im&aacute;genes que reflejen la diversidad con la que estamos comprometidos.<br /><br />Las colecciones en que se indica &quot;Colecci&oacute;n ISFTIC&quot; se han realizado con im&aacute;genes del Instituto Superior de Formaci&oacute;n y Recursos en Red para el Profesorado del Ministerio de Educaci&oacute;n,&nbsp;al que expresamos nuestro agradecimiento.<br /><br /><strong>Condiciones de uso:<br /></strong><br />La utilizaci&oacute;n de las im&aacute;genes de las siguientes colecciones es universal, gratuita y abierta, siempre y cuando se trate de un uso educativo no comercial. Las acciones, productos y utilidades derivadas de su utilizaci&oacute;n no podr&aacute;n, en consecuencia, generar ning&uacute;n tipo de lucro. Asimismo, es obligada la referencia a la fuente&nbsp; (ISFTIC o CREADE) cuando se incluyan cualquiera de los documentos en materiales did&aacute;cticos y formativos, seg&uacute;n los criterios anteriormente expuestos. El disfrute de las im&aacute;genes supone la aceptaci&oacute;n de estas condiciones de uso.</p>',null,null);
Insert into ITMT_I (ID,ID_IDIOMA,TITULO,ENTRADILLA,ALTIMAGEN,ENTRADILLA_LISTA_DESCARGA) values ('27','112','Coleccións de fotos','Ofrecemos estas primeiras colecci&oacute;ns de fotos coa intenci&oacute;n de iniciar un proxecto com&uacute;n no que todas e todos poidamos compartir imaxes que reflicten a diversidade coa que estamos comprometidos.<br /><br />As colecci&oacute;ns en que se indica &quot;Colecci&oacute;n CNICE&quot;&nbsp;realizaronse con imaxes do Centro Nacional de Informaci&oacute;n e Comunicaci&oacute;n Educativa do Ministerio de Educaci&oacute;n e Ciencia, ao que expresamos o noso agradecemento.<br /><br /><strong>Condici&oacute;ns de uso:<br /></strong><br />A utilizaci&oacute;n das imaxes das seguintes colecci&oacute;ns &eacute; universal, gratu&iacute;ta e aberta, sempre e cando se trate dun uso educativo non comercial. As acci&oacute;ns, produtos e utilidades derivadas da s&uacute;a utilizaci&oacute;n non poder&aacute;n, en consecuencia, xerar ning&uacute;n tipo de lucro. As&iacute; mesmo, &eacute; obrigada a referencia &aacute; fonte (CNICE ou CREADE) cando se incl&uacute;an calquera dos documentos en materiais did&aacute;cticos e formativos, segundo os criterios anteriormente expostos. O goce das imaxes sup&oacute;n a aceptaci&oacute;n destas condici&oacute;ns de uso.',null,null);
