Insert into ITMT_I (ID,ID_IDIOMA,TITULO,ENTRADILLA,ALTIMAGEN,ENTRADILLA_LISTA_DESCARGA) values ('1201','0','Ministerio de Educación, Cultura y Deporte - Centro Nacional de Innovación e Investigación Educativa',null,null,'<p>Los siguientes documentos del Centro Nacional de Innovación e Investigación Educativa (CNIIE) re&uacute;nen datos significativos sobre la presencia del alumnado extranjero en el sistema educativo espa&ntilde;ol extra&iacute;dos de las &quot;Estad&iacute;sticas de las Ense&ntilde;anzas no universitarias&quot; realizadas anulamente por la Oficina de Estad&iacute;stica del Ministerio de Educaci&oacute;n. Presentan, por una parte, una visi&oacute;n panor&aacute;mica del poceso de incorporaci&oacute;n del alumnado extranjero en el sistema educativo espa&ntilde;ol. Por otra, ofrecen un panorama&nbsp; preciso y detallado de los &uacute;ltimos cursos escolares acot&aacute;ndose la informaci&oacute;n al cruce de las siguientes variables:&nbsp; regi&oacute;n geogr&aacute;fica de procedencia del alumnado, Comunidad Aut&oacute;noma, nivel educativo y titularidad del centro.&nbsp;<br /><br /><br /><br /></p>');
