Insert into ITMT_I (ID,ID_IDIOMA,TITULO,ENTRADILLA,ALTIMAGEN,ENTRADILLA_LISTA_DESCARGA) values ('1605','0','Concurso Nacional de Buenas Prácticas para el impulso y la mejora de la Convivencia',null,null,'<p>La Secretar&iacute;a de Estado de Educaci&oacute;n y Formaci&oacute;n Profesional convoca el CONCURSO NACIONAL de BUENAS PR&Aacute;CTICAS para el impulso y mejora de la CONVIVENCIA, para el curso 2010-2011.<br />Los premios est&aacute;n dirigidos a los centros docentres espa&ntilde;oles sostenidos con fondos p&uacute;blicos que impartan ense&ntilde;anzas de 2&ordm; ciclo de Educaci&oacute;n Infantil, Educaci&oacute;n Primaria, Educaci&oacute;n Especial, Educaci&oacute;n Secundaria Obligatoria, Bachillerato, Formaci&oacute;n Profesional o Ense&ntilde;anzas de R&eacute;gimen Especial. </p>');
