Insert into ITMT_I (ID,ID_IDIOMA,TITULO,ENTRADILLA,ALTIMAGEN,ENTRADILLA_LISTA_DESCARGA) values ('1611','0','Políticas educativas','<p>En esta secci&oacute;n se ofrece una recopilaci&oacute;n de las pol&iacute;ticas educativas que las Administraciones Educativas est&aacute;n desarrollando en relaci&oacute;n con el alumnado extranjero.<br />En un pa&iacute;s con 18 Administraciones Educativas resulta dif&iacute;cil, a menudo, conocer qu&eacute; medidas&nbsp;se est&aacute;n llevando a cabo&nbsp;para dar una respuesta adecuada a las necesidades que presenta el alumnado extranjero, en cada uno de los territorios.&nbsp;<br />El objetivo de esta secci&oacute;n es ofrecer una visi&oacute;n de conjunto de las actuaciones que en este sentido se est&aacute;n implantando.<br /></p>',null,'En esta secci&oacute;n se ofrece una recopilaci&oacute;n de las pol&iacute;ticas educativas que las Administraciones Educativas est&aacute;n desarrollando en relaci&oacute;n con el alumnado extranjero.');
